import React from 'react'
import './Netflix.css'

const linkedin="https://www.linkedin.com/feed/";
export default function Netflix() {
    return (
        
        <div class="netflix">

        <div >Dark</div>
        <div>Breking bad</div>
        <div>Money heist</div>
        <div> Peaky blinders</div>
 <a href={linkedin}> google</a>

        </div>
            
        
    )
}
